import './App.css';

const App = () => {
  return (
    <Router>
      <Fragment>
        <AwesomeSlider>
          <div className='container'>
            <div>1</div>
            <div>2</div>
            <div>3</div>
            <div>4</div>
          </div>
        </AwesomeSlider>
      </Fragment>
    </Router>
  );
}

export default App;
